import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import Dashboard from './components/Dashboard';
import EmergencyContact from './components/EmergencyContact';
import AIPrediction from './components/AIPrediction';
import VolunteerRegistration from './components/VolunteerRegistration';

function App() {
  return (
    <BrowserRouter>
      <div className="min-h-screen bg-background text-gray-900">
        <nav className="bg-primary text-white p-4 flex space-x-4">
          <Link to="/" className="hover:underline">Home</Link>
          <Link to="/dashboard" className="hover:underline">Dashboard</Link>
          <Link to="/emergency" className="hover:underline">Emergency Contacts</Link>
          <Link to="/ai-prediction" className="hover:underline">AI Prediction</Link>
          <Link to="/volunteer" className="hover:underline">Volunteer Registration</Link>
        </nav>
        <main className="p-4">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/emergency" element={<EmergencyContact />} />
            <Route path="/ai-prediction" element={<AIPrediction />} />
            <Route path="/volunteer" element={<VolunteerRegistration />} />
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
